import React from "react";

const Alphabet = () => {
  return (
    <div>
      <a href="https://imgbb.com/">
        <img src="https://i.ibb.co/rv11Qhs/image.jpg" alt="image" border="0" />
      </a>
    </div>
  );
};

export default Alphabet;
